import "./styles.css";

const Item = ({ number }) => (
  <div className="item">
    <p>{number}</p>
    <div className="divider" />
    <button>Remove</button>
  </div>
);

const App = () => {
  return (
    <div className="App">
     >
    </div>
  );
};

export default App;
